import React from "react";

function App() {
  function clicked() {
    const varriable = document.getElementById("testtext");
    varriable.style.color = "red";
  }
  return (
    <>
      <h1 id="testtext">i am a text</h1>
      <button id="myButton" onClick={clicked}>
        press me to alert
      </button>
    </>
  );
}
export default App;
